import React from "react";
import Container from "react-bootstrap/Container";

const Aboutpage = () => {
  return (
    <div className="content">
      <div className="container">
        <h1 className="m-5"> เกี่ยวกับบริษัท</h1>
      </div>
    </div>
  );
};

export default Aboutpage;
